import React from "react";

class NASARow extends React.Component {
  render() {
    return (
      <table key={this.props.nasaItem.id}>
        <tbody>
          <tr>
            <td>
              <img
                alt="item graphic"
                width="200"
                src={this.props.nasaItem.image_src}
              />
            </td>
            <td>
              <p>
                <strong>{this.props.nasaItem.data[0].title}</strong>
              </p>
              <p>{this.props.nasaItem.data[0].description}</p>
              <input type="button" value="view" />{" "}
              <p>Provided by: {this.props.nasaItem.data[0].center}</p>
            </td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default NASARow;
